func TestCache_Search(t *testing.T) {
	var (
		d1 = time.Date(1991, 1, 1, 0, 0, 0, 0, time.UTC)
		d2 = time.Date(1993, 12, 31, 0, 0, 0, 0, time.UTC)
		d3 = time.Date(2015, 1, 1, 0, 0, 0, 0, time.UTC)
		d4 = time.Date(2015, 12, 31, 0, 0, 0, 0, time.UTC)
	)

	testCases := []struct {
		name      string
		opts      []SearchOpt
		wantCount int
	}{
		{
			name:      "afnemer exact",
			opts:      []SearchOpt{Afnemer(1403)},
			wantCount: 1,
		},
		{
			name:      "afnemer from",
			opts:      []SearchOpt{AfnemerFrom(22000)},
			wantCount: 5,
		},
		{
			name:      "afnemer to",
			opts:      []SearchOpt{AfnemerTo(16000)},
			wantCount: 6,
		},
		{
			name:      "afnemer range",
			opts:      []SearchOpt{AfnemerFrom(20000), AfnemerTo(21000)},
			wantCount: 5,
		},
		{
			name:      "naam from",
			opts:      []SearchOpt{NaamFrom("Gemeente Hen")},
			wantCount: 5,
		},
		{
			name:      "naam to",
			opts:      []SearchOpt{NaamTo("Gemeente Beup")},
			wantCount: 5,
		},
		{
			name:      "naam rx (1)",
			opts:      []SearchOpt{NaamRX(regexp.MustCompile(`Gemeente.*nge.*`))},
			wantCount: 16,
		},
		{
			name:      "datum ingang range",
			opts:      []SearchOpt{DatumIngangFrom(d1), DatumIngangTo(d2)},
			wantCount: 2,
		},
		{
			name:      "datum einde range",
			opts:      []SearchOpt{DatumEindeFrom(d3), DatumEindeTo(d4)},
			wantCount: 4,
		},
	}

	c, err := New(loader)
	require.NoError(t, err)
	require.NotNil(t, c)

	for _, tc := range testCases {
		t.Run(tc.name, func(t *testing.T) {
			got := c.Search(tc.opts...)
			assert.Equal(t, tc.wantCount, len(got))
		})
	}
}
